import React, { Component } from "react";
import styled from "styled-components";

export const LeftPanelStyle = styled.section`
    text-align: left;
    background-color: #424242;
    position: relative;
    width: 20%;
    height: 100%;
    float: left;
`;

export const LeftPanelMenuStyle = styled.menu`
    text-align: center;
    background-color: #616161;
    position: relative;
    width: 90%;
    height: 50%;
    float: left;
    padding: 10px 10px 10px 10px;
`;

export const LeftPanelMenuItemStyle = styled.menuitem`
    text-align: left;
    background-color: #f5f5f5;
    position: relative;
    width: 100%;
    height: 50%;
    float: left;
`;

interface Props {}

interface State {}

class LeftPanel extends Component<Props, State> {
    state = {
        isActive: true,
    };

    render() {
        return (
            <LeftPanelStyle>
                <LeftPanelMenuStyle></LeftPanelMenuStyle>
            </LeftPanelStyle>
        );
    }
}

export default LeftPanel;
